def getLatLong(lats, lons, actualLat, actualLon):
	lonPlace = float("inf")
	lonsCount = 0
	for thing in lons:
		if (math.fabs(thing-actualLon) < 0.1):
			lonPlace = lonsCount
			break
		lonsCount += 1
	latPlace = float("inf")
	latsCount = 0
	for thing in lats:
		if (math.fabs(thing-actualLat) < 0.1):
			latPlace = latsCount
			break
		latsCount += 1
	return (lonPlace, latPlace)
	
def getAllFiles():
	chloroFiles = []
	count = 0
	for chloroFile in os.listdir('chlorophyllData'):
		chloroFilename = "chlorophyllData/" + str(chloroFile)
		chloroData = Dataset(chloroFilename, mode="r")
		if count == 0:
			lons = chloroData.variables['lon'][:]
			lats = chloroData.variables['lat'][:]
		#lons = chloroData.variables['lon'][:]
